// Pass webhook data through without wrapping
const parsed = $input.first().json;

// Log for debugging
console.log('=== WEBHOOK RECEIVED ===');
console.log('Industry:', parsed.body?.industry);
console.log('SIC Codes:', parsed.body?.sic_codes);
console.log('Countries:', parsed.body?.countries);

// Pass the data as-is to Code5
return [{ json: parsed }];

// Transform webhook data for Apollo API with SIC codes
const parsed = $input.first().json || {};

// Extract data - handle both debug_fullObject and direct body
const webhookData = parsed.debug_fullObject?.body || parsed.body || {};
const industry = webhookData.industry || "";
const sicCodes = webhookData.sic_codes || [];
const countries = webhookData.countries || [];

console.log('=== APOLLO API PAYLOAD BUILDER ===');
console.log('1. Industry selected:', industry);
console.log('2. SIC Codes received:', sicCodes);
console.log('3. Countries received:', countries);

// Build Apollo API payload with ALL countries
const body = {
  organization_sic_codes: sicCodes,
  person_locations: countries,
  person_titles: [
    "CEO","COO","Director","President","Owner","Founder","Board of Directors"
  ],
  page: 1,
  per_page: 5,
  // Pass original industry through for later use
  _industry_filter: industry
};

console.log('4. Final Apollo API payload:', JSON.stringify(body, null, 2));
console.log('=== END ===');

return [{ json: body }];
